import * as React from "react";
import "./Experience.css";
import logo from "../../Images/tillsterlogo.jpeg";
import info from "../../Images/tillster.png";
import taxfyle from "../../Images/tax.png";
import gw from "../../Images/gw.png";
import iphone from "../../Images/iphone.png";
import RestaurantIcon from "@mui/icons-material/Restaurant";
import Box from "@mui/material/Box";
import AudiotrackIcon from "@mui/icons-material/Audiotrack";
import ImportContacts from "@mui/icons-material/ImportContacts";
import PersonIcon from "@mui/icons-material/Person";
function Experience() {
  const [count, setCount] = React.useState(0);
  const text =
    count === 0
      ? info
      : count === 1
      ? taxfyle
      : count === 2
      ? iphone
      : count === 3
      ? logo
      : iphone;
  return (
    <div id="experience">
      <div className="flexText">
        <h3 className="header">Projects</h3>
        <p>
          A peek into the projects I've been a part of over the past few years.
        </p>
      </div>
      <div className="flexExperience">
        <div className="gridTitles">
          <a onClick={() => setCount(2)} className="text">
            <Box
              sx={{
                width: 270,
                height: 270,
                borderRadius: 6,
                backgroundColor: "#91be4a",
                boxShadow: "0 3px 10px rgb(0 0 0 / 0.2)",
              }}
            >
              <div className="gridText">
                <RestaurantIcon color="white" />
                <h4>Tillster </h4>
                <h6>2018 - 2021</h6>
              </div>
            </Box>
          </a>
          <a onClick={() => setCount(3)} className="text">
            <Box
              sx={{
                width: 270,
                height: 270,
                borderRadius: 6,
                backgroundColor: "#91be4a",
                boxShadow: "0 3px 10px rgb(0 0 0 / 0.2)",
              }}
            >
              <div className="gridText">
                <PersonIcon />
                <h4>Taxfyle</h4>
                <h6>2019-2020</h6>
              </div>
            </Box>
          </a>
        </div>
        <div className="gridTitles">
          <a onClick={() => setCount(2)} className="text">
            <Box
              sx={{
                width: 270,
                height: 270,
                borderRadius: 6,
                backgroundColor: "#91be4a",
                boxShadow: "0 3px 10px rgb(0 0 0 / 0.2)",
              }}
            >
              <div className="gridText">
                <AudiotrackIcon />
                <h4>WVUM - FM </h4>
                <h6>2018 - 2021</h6>
              </div>
            </Box>
          </a>
          <a onClick={() => setCount(3)} className="text">
            <Box
              sx={{
                width: 270,
                height: 270,
                borderRadius: 6,
                backgroundColor: "#91be4a",
                boxShadow: "0 3px 10px rgb(0 0 0 / 0.2)",
              }}
            >
              <div className="gridText">
                <ImportContacts />
                <h4>Graphic Design Final Magazine</h4>
                <h6>2021</h6>
              </div>
            </Box>
          </a>
        </div>
      </div>
    </div>
  );
}
export default Experience;
